import React, { useEffect, useState } from 'react'
import {Link} from 'react-router-dom'
import './Navbar.css'


const Navbar = () => {


    const [name,setName]=useState("dh1264");
    const [email,setEmail]=useState('dh.jj@f.c');

    useEffect(()=>{
        fetch("http://localhost:8000/success-log",{
            method: "POST",
            headers:{
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                token:window.localStorage.getItem("token")
            })

        })
        .then((res)=>res.json())
        .then((data)=>{
            console.log(data,"userdata");
            setName(data.data.userid)
            setEmail(data.data.email);
        })
    })

    return (
        <>
            <div className='navbar'>

                <Link to='/Coins'><h1> Crypto <span className='purple'>Tracker</span></h1></Link>
                <nav>
                    <ul>      
                        <li>Home</li>
                        <li>Cryptocurrencies</li>
                        <li>Wishlist</li>                  
                        <li class="user-det">Hi {name}<br/><span className='secon'>{email}</span></li>                    
                    </ul>
                </nav>

            </div>
        </>
    )
}

export default Navbar
